import React from 'react';
import Auth from './Auth';
import { useState } from 'react';

const Account = () => {
  const [isLogin, setIsLogin] = useState(true);
  const handleChange = (e) => {
    setIsLogin(e);
  };

  return (
    <>
      {isLogin && <Auth />}
      {isLogin && <div>Hello</div>}
    </>
  );
};

export default Account;
